import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const colors = theme.palette.colors;

  return {
    container: {
      display: "flex",
      flexDirection: "column",
      width: "100%",
      marginTop: "200px",
      alignItems: "center"
    },
    intro: {
      color: colors.secondary,
      fontFamily: "Roboto",
      fontSize: "20px",
      marginRight: "270px"
    },
    name: {
      color: "white",
      fontSize: "80px"
    }
  };
});
